import React, { Component } from 'react'
import { Route, Link } from "react-router-dom";

class Header extends Component {
  render() {
    return (
      <div className="header">
        <div className="header__title">MARI VANNA</div>
        <div className="header__navbar">

        <a className="header__atag" target='blank' href='#'>RESERVATION</a>



        <Link className="header__atag" to="">MENU</Link>
        <a className="header__atag" target='blank' href='https://www.opentable.com/r/mari-vanna-new-york'>RESERVATION</a>

        </div>
      </div>
    )
  }
}

export default Header
